import React from 'react';
import { Link } from 'react-router-dom';
import { AppBar, Toolbar, IconButton, Typography, Button, Paper, Grid } from '@mui/material';
import HomeIcon from '@mui/icons-material/Home';
import '../style/HomeBis.css';

function HomeBis() {
    return (
      <div style={{ display: 'flex', flexDirection: 'column', height: '100vh' }}>
        <AppBar position="static" color="inherit" elevation={0}>
          <Toolbar>
            {/* ... */}
          </Toolbar>
        </AppBar>
  
        {/* Centered text div */}
        <div style={{ flex: 1, display: 'flex', alignItems: 'center', justifyContent: 'center' }}>
          <Typography variant="h4">Your Centered Text Here</Typography>
        </div>
  
        <div style={{ padding: '0 24px', height: 'calc(0.66 * (100vh - 64px))' }}>
          <Grid container spacing={3} style={{ height: '100%', alignItems: 'flex-end' }}>
            {["/Bio", "/Projects", "/Experience"].map((route, index) => (
              <Grid item xs={4} key={index} style={{ height: '100%', display: 'flex', alignItems: 'flex-end' }}>
                <Link to={route} style={{ textDecoration: 'none', height: '100%' }}>
                  <Paper 
                    elevation={0} 
                    className="grid-item-paper hoverable-grid-item"
                    style={{ background: '#F4F3F1', height: 'calc(0.6 * (100vh - 64px))' }}
                  >
                    <Paper elevation={5} className="inner-paper" style={{ width: '70%', height: '50%', background: '#EFEFEF' }} />
                  </Paper>
                </Link>
              </Grid>
            ))}
          </Grid>
        </div>
      </div>
    );
  }
  

export default HomeBis;
